var canvas = document.getElementById("elementCanvas");
var canvasPeriodic = document.getElementById("periodicCanvas");
var nucleusCanvas = document.getElementById("nucleusCanvas");
var ctx = canvas.getContext("2d");
var ctxPeriodic = canvasPeriodic.getContext("2d");
var nucleusctx = nucleusCanvas.getContext("2d");
var widou = 3;
var heightou = 3;
var widouP = 20;
var heightouP = 20;
if (!rects) {
	var rects = [
		{ x: widou, y: 0, w: widou, h: heightou, color: "rgb(0,0,0)", colorhover: "rgb(100, 100, 100)" }
	], i = 0, r, rP;
}
if (!rectsPeriodic) {
	var rectsPeriodic = [];
	for (i = 0; i < game.realElementMax; i++) {
		rectsPeriodic.push({
			chemicalType: "?", actualNuc: "false" , name: "?", symbol: "", type: "?", Z: i, x: widouP * game.chemicalPeriodicPos[i][0], y: heightouP * game.chemicalPeriodicPos[i][1], w: widouP, h: heightouP, color: "rgb(150,150,150)", colorhover: "rgb(200, 200, 200)"
		});
	}
	rectsPeriodic[1].name = game.chemicalName[1];
	rectsPeriodic[1].symbol = game.chemicalSymbol[1];
	rectsPeriodic[1].Z = 1;
	rectsPeriodic[1].actualNuc = "true";
	rectsPeriodic[1].color = game.periodicTypeColor[game.chemicalPeriodicType[1]];
	rectsPeriodic[1].colorhover = game.periodicTypeColorHover[game.chemicalPeriodicType[1]];
}

if (!rectsNucleus) {
	var rectsNucleus = [], rN;
}

canvasinit = function () {
	i = 0;
	while (r = rects[i++]) {
		ctx.beginPath();
		ctx.rect(r.x, r.y, r.w, r.h);
		if (Math.round(r.x / widou) == game.nucleonsCount[0] && Math.round(r.y / heightou) == game.nucleonsCount[1]) {
			ctx.fillStyle = game.selectedColor;
		}
		else {
			ctx.fillStyle = r.color;
		}
		ctx.fill();
	}
}
canvasPinit = function () {
	i = 0;
	while (rP = rectsPeriodic[i++]) {
		ctxPeriodic.beginPath();
		ctxPeriodic.rect(rP.x, rP.y, rP.w, rP.h);
		if (i == game.nucleonsCount[0] + 1) {
			ctxPeriodic.fillStyle = game.selectedColor;
		}
		else {
			ctxPeriodic.fillStyle = rP.color;
		}
		ctxPeriodic.fill();
		ctxPeriodic.strokeStyle = "black";
		ctxPeriodic.stroke();
		ctxPeriodic.fillStyle = "black";
		ctxPeriodic.font = "10px Arial";
		ctxPeriodic.fillText(rP.symbol, rP.x + rP.w / 4, rP.y + 3 * rP.h / 4);
	}
}
canvasNinit = function () {
	if (game.nucleonsCount[0] >= game.lowQNuc) {
		var pixSize = 3;
		var maxPix = pixSize * 20;
		var randouTemp = 0;
		var nucleusPixCount = [0, 0];
		var colou = 0;
		nucleusctx.clearRect(0, 0, 1000, 1000);
		radius = Math.sqrt(game.nucleonsTot / Math.PI) + 1;
		for (var i = 10- radius; i < 10 + radius; i++) {
			for (var j = 10 - radius; j < 10 + radius; j++) {
				if ((i - 10) ** 2 + (j - 10) ** 2 < radius ** 2) {
					nucleusctx.fillStyle = "black";
					nucleusctx.fillRect(i * pixSize, j * pixSize, pixSize, pixSize);
				}
			}
		}
		rectsNucleus = [];
		for (var i = 0; i < game.nucleonsTot; i++) {
			randouTemp = Math.round(randomNumber(0, 1));
			if (nucleusPixCount[0] >= game.nucleonsCount[0]) {
				nucleusPixCount[1]++;
				colou = game.nucleusColor[1];
			}
			else if (nucleusPixCount[1] >= game.nucleonsCount[1]) {
				nucleusPixCount[0]++;
				colou = game.nucleusColor[0];
			}
			else {
				nucleusPixCount[randouTemp]++;
				colou = game.nucleusColor[randouTemp];
			}
			rectsNucleus.push({ col: colou, x: maxPix / 2 + (spiralround(i)[0] + Math.ceil(randomNumber(-1, 1))) * pixSize, y: maxPix / 2 + (spiralround(i)[1] + Math.ceil(randomNumber(-1, 1))) * pixSize, w: pixSize, h: pixSize });
		}
		i = 0;
		while (rN = rectsNucleus[i++]) {
			nucleusctx.beginPath();
			nucleusctx.fillStyle = rN.col;
			nucleusctx.rect(rN.x, rN.y, rN.w, rN.h);
			nucleusctx.fill();
			nucleusctx.closePath();
		}
	}
	else { nucleusctx.clearRect(0, 0, 0, 0); }
}

canvasinit();
canvasPinit();
//canvasNinit();

canvas.onmousemove = function (e) {
	// important: correct mouse position:
	var rect = this.getBoundingClientRect(),
		x = e.clientX - rect.left,
		y = e.clientY - rect.top,
		i = 0, r;

	while (r = rects[i++]) {
		// add a single rect to path:
		ctx.beginPath();
		ctx.rect(r.x, r.y, r.w, r.h);

		// check if we hover it
		if (Math.round(r.x / widou) == game.nucleonsCount[0] && Math.round(r.y / heightou) == game.nucleonsCount[1]) {
			ctx.fillStyle = ctx.isPointInPath(x, y) ? game.selectedColorHover : game.selectedColor;
		}
		else {
			ctx.fillStyle = ctx.isPointInPath(x, y) ? r.colorhover : r.color;
		}
		if (ctx.isPointInPath(x, y)) {
			document.querySelector('.modal').classList.toggle('show');
			document.querySelector('.modal').style.left = x + rect.left + 20 + "px";
			document.querySelector('.modal').style.top = y + rect.top + 20 + "px";
			document.getElementById("modalContainer").innerHTML = '<p>' + game.chemicalSymbol[Math.round(r.x / widou)] + ' ' + Math.round((r.x + r.y) / heightou) + ' (' + game.chemicalDecay[Math.round(r.x / widou)][Math.round(r.y / heightou)] + ') </p>'
		}
		ctx.fill();
	}
};

canvasPeriodic.onmousemove = function (e) {
	// important: correct mouse position:
	var rect = this.getBoundingClientRect(),
		x = e.clientX - rect.left,
		y = e.clientY - rect.top,
		i = 0, rP;
	while (rP = rectsPeriodic[i++]) {
		// add a single rect to path:
		ctxPeriodic.beginPath();
		ctxPeriodic.rect(rP.x, rP.y, rP.w, rP.h);

		// check if we hover it
		if (i == game.nucleonsCount[0]+1) {
			ctxPeriodic.fillStyle = ctxPeriodic.isPointInPath(x, y) ? game.selectedColorHover : game.selectedColor;
		}
		else {
			ctxPeriodic.fillStyle = ctxPeriodic.isPointInPath(x, y) ? rP.colorhover : rP.color;
        }
		if (ctxPeriodic.isPointInPath(x, y)) {
			document.querySelector('.modalP').classList.toggle('show');
			document.querySelector('.modalP').style.left = x + rect.left + 20 + "px";
			document.querySelector('.modalP').style.top = y + rect.top + 20 + "px";
			document.getElementById("modalContainerP").innerHTML = '<p>' + rP.name + ' ' + rP.symbol + '</p><p> ' + rP.chemicalType + ' ( Z = ' + rP.Z + ' ) </p>'
		}
		ctxPeriodic.fill();
		ctxPeriodic.strokeStyle = "black";
		ctxPeriodic.stroke();
		ctxPeriodic.fillStyle = "black";
		ctxPeriodic.font = "10px Arial";
		ctxPeriodic.fillText(rP.symbol, rP.x + rP.w / 4, rP.y + 3 * rP.h / 4);
	}
};

function visitGrid(p, n, decay, updatebool) {
	if (game.isotopSeen[p][n] == "false" || updatebool == "true") {
		if (game.chemicalSeen[p] == "false") {
			game.chemicalSeen[p] = "true";
			game.totalElement++;
		}
		game.isotopSeen[p][n] = "true";
		game.totalIsotope++;
		if (decay == "stable") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(0, 0, 0)", colorhover: "rgb(100, 100, 100)" });
		}
		else if (decay == "b-" || decay == "2b-" || decay == "b-n" || decay == "b-2n") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(0, 100, 255)", colorhover: "rgb(100, 200, 255)" });
		}
		else if (decay == "b-gamma") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(255, 255, 0)", colorhover: "rgb(255, 255, 150)" });
		}
		else if (decay == "b+" || decay == "2b+" || decay == "b+p" || decay == "b+2p") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(255, 100, 255)", colorhover: "rgb(255, 200, 255)" });
		}
		else if (decay == "EC" || decay == "2EC") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(200, 100, 0)", colorhover: "rgb(200, 150, 100)" });
		}
		else if (decay == "n" || decay == "2n" || decay == "3n") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(150, 150, 150)", colorhover: "rgb(200, 200, 200)" });
		}
		else if (decay == "p" || decay == "2p" || decay == "3p") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(255, 0, 0)", colorhover: "rgb(255, 100, 100)" });
		}
		else if (decay == "alpha" || decay == "b+alpha") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(0, 150, 0)", colorhover: "rgb(100, 200, 100)" });
		}
		else if (decay == "SF") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(255, 150, 0)", colorhover: "rgb(255, 255, 100)" });
		}
		else if (decay == "") {
			rects.push({ x: widou * p, y: heightou * n, w: widou, h: heightou, color: "rgb(240, 240, 240)", colorhover: "rgb(250, 250, 250)" });
		}
		else {
			alert(decay);
        }
	}
	canvasinit();
	//canvasNinit();
}

function visitGridP(p) {
	if (game.chemicalSeen[p] == "true") {
		if (!rectsPeriodic[p]) {
			rectsPeriodic.push({
				chemicalType: game.chemicalPeriodicTypeName[game.chemicalPeriodicType[p]], actualNuc: "true", name: game.chemicalName[p], symbol: game.chemicalSymbol[p], type: game.chemicalPeriodicType[p], Z: p, x: widouP * game.chemicalPeriodicPos[p][0], y: heightouP * game.chemicalPeriodicPos[p][1], w: widouP, h: heightouP, color: game.periodicTypeColor[game.chemicalPeriodicType[p]], colorhover: game.periodicTypeColorHover[game.chemicalPeriodicType[p]]
			});
		}
		else {
			rectsPeriodic[p].name = game.chemicalName[p];
			rectsPeriodic[p].symbol = game.chemicalSymbol[p];
			rectsPeriodic[p].Z = p;
			rectsPeriodic[p].type = game.chemicalPeriodicType[p];
			rectsPeriodic[p].color = game.periodicTypeColor[game.chemicalPeriodicType[p]];
			rectsPeriodic[p].colorhover = game.periodicTypeColorHover[game.chemicalPeriodicType[p]];
			rectsPeriodic[p].chemicalType = game.chemicalPeriodicTypeName[game.chemicalPeriodicType[p]];
		}
	}
	canvasPinit();
}

